import { Link, useNavigate } from 'react-router-dom';
import "./Navbar.modules.css";
import logo from '../../img/logo.png'
import Globais from '../Globais';
import React from 'react';
import NovaConta from '../NovaConta';
import iconeLupa from '../../img/iconeLupa.png'
import iconeSair from '../../img/iconeLogout.png'
import fotoPerfil from '../../img/user2.png'

//navbar do feed

function Navbar() {
    const navigate = useNavigate();

    const logout = () => {
        localStorage.setItem("login", 0);
        //localStorage.setItem("id", 0);
    }

    const navegarPerfil = () => {
        navigate("/feed");
    }

    return (
        <>
            {/**menu feito anteriormente*/}
            <nav className="navbar">
                <div>

                    <ul className="list">
                        <li className="item">
                            <Link to="/perfil">Perfil</Link>
                        </li>
                        <li className="item">
                            <Link to="/grupos/lol">Grupos</Link>
                        </li>
                        <li className="item">
                            
                        </li>
                    </ul>

                    <div className='headerMenu'>
                        {/** Logo Fybs">*/}
                        <div className="logoMenu">
                            <button className='button' onClick={navegarPerfil}>
                                <img className="image" src={logo} alt="fybs" />
                            </button>
                        </div>
                        {/** Foto do perfil ">*/}
                        <div className='perfilMenu'>
                        <button className="button" onClick={navegarPerfil}> <img src={logo} /> </button>
                            <select name="@fybs" id="cars">
                                <option value="volvo">Volvo</option>
                                <option value="saab">Saab</option>
                                <option value="mercedes">Mercedes</option>
                                <option value="audi">Audi</option>
                            </select>
                        </div>
                        {/** Campo de busca ">*/}
                        <div className="searchMenu">
                            <form>
                                <input type="text" className="txtBusca" placeholder='Busque na Fybs...' />
                            </form>
                            <img src={iconeLupa} className="btnBusca" alt='fybs' />
                        </div>
                        {/** BotÃ£o de sair ">*/}
                        <div className="exit">
                        <Link to="/" onClick={logout}>
                            <img className="btnSair" src={iconeSair} alt="fybs" />
                        </Link>
                        </div>
                    </div>
                </div>
            </nav>
        </>
    );
}

export default Navbar;
